import React from 'react';
import { Button, Typography, Grid, AppBar, Toolbar} from '@material-ui/core';
import { makeStyles, ThemeProvider} from '@material-ui/core/styles';
import { blue } from '@material-ui/core/colors';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import { defaultProps, propTypes } from 'react-codemirror';

const Index = (props) => {

    const indexStyles = makeStyles({
        root: {
            color: "white",
            position: "static",
            height: "46px",
            borderRadius: "8px"
        }
    })

    const classes = indexStyles();

    const handleCommunity = () => {
        fetch('http://localhost:3000/api/v1/projects')
            .then(res => res.json())
            .then(console.log)
    }

    const handlePersonal = () => {

    }

    return(
        <Grid container style={{backgroundColor: "white", marginRight: "20px", marginLeft: "20px", marginBottom: "20px", borderRadius: "20px", borderStyle: "solid", borderColor: "black", borderWidth: "5px"}} elevation={3}>
            <AppBar className={classes.root} >
                <Tabs variant="fullWidth">
                    <Tab label="My codes" onClick={handlePersonal}/>
                    <Tab label="Community codes" onClick={handleCommunity}/>
                </Tabs>
            </AppBar>
            <Grid item container>
                <ul id=''>

                </ul>
            </Grid>
        </Grid>
    );
}

export default Index;
